		padding: "8px 18px",
	},
	title: {
		fontSize: 20,
		lineHeight: "30px",
		fontWeight: 600,
		color: "#00ECEC",
	},
	description: {
		fontSize: 17,
		lineHeight: "25px",
		color: "#ffffff",
	},
	link: {
		fontSize: 17,
		color: "#00ECEC",
		lineHeight: "25px",
		fontWeight: 500,
	},
	button: {
		background: "transparent",
		border: "1px solid #00ECEC",
		width: 154,
		height: 40,
		borderRadius: 8,
		fontSize: 13,
		marginTop: 24,
		marginBottom: 24,
		fontWeight: 500,
		textAlign: "center",
		alignItems: "center",
		color: "#ffffff",
	},
});

export default WorkMob;
